import React from "react";
import "./About.css";
import me from "../img/eileen2.png";

const About = () => {
    return (
        <div className="description">
            <img src={me} alt="Eileen"></img>
            <div className="bio">
              <p>Hi, it's so nice to meet you! 
                  I'm Eileen, an aspiring Experience Designer and Prototyper. While I'm not crafting experiences 
                  I'll be drawing, playing some tunes on the guitar, or in the studio ballroom dancing. One of my 
                  favorite lines is from </p>
              <blockquote cite="J.R.R. Tolkien">
                "All that is gold does not glitter,
                <br></br>
                Not all those who wander are lost"
              </blockquote>
              <p>
                <br></br><br></br> 
                I am currently looking for full-time jobs. 
                <br></br><br></br> 
                Browse some of my work and feel free to reach out!</p>
            </div>
        </div>
    );
  };

export default About;
